import React from "react";
import {Container, Nav, Navbar} from "react-bootstrap";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <Navbar collapseOnSelect bg="primary" expand="lg" variant="dark">
      <Container fluid>
        <Navbar.Brand className="text-warning" as={NavLink} to="/">Royal Resta</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />

        <Navbar.Collapse>

          <Nav className="m-auto">
            <Nav.Link href="/">
              <Link to="/">Inicio</Link>
            </Nav.Link>
            <Nav.Link href="/informacion">
              <Link to="/informacion">Informaci√≥n</Link>
            </Nav.Link>
            <Nav.Link href="/ayuda">
              <Link to="/ayuda">Ayuda</Link>
            </Nav.Link>
          </Nav>

          <Nav>
            <Nav.Link as="button" className="btn btn-outline-warning" href="#">Perfil</Nav.Link>
          </Nav>

        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
